import { Component } from "@angular/core";

@Component({
  selector: "app-navbar",
  templateUrl: "./navbar.component.html",
  styleUrls: ["./navbar.component.scss"],
})
export class NavbarComponent {
  items = [
    {
      title: "",
      link: "",
      icon: "",
    },
    {
      title: "",
      link: "",
      icon: "",
    },
    {
      title: "",
      link: "",
      icon: "",
    },
    {
      title: "",
      link: "",
      icon: "",
    },
    {
      title: "",
      link: "",
      icon: "",
    },
  ];
}
<nav id="nav">
  <div class="container">
    <img src="/assets/main.png" alt="not found" />

    <div *ngFor="let item of items">
      <div></div>
    </div>
  </div>
</nav>
